import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';
import Contact from '../pages/Contact';

const NContainer = styled.N`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 1rem 2rem;
  background-color: #6c63ff;
  color: white;
`;

const NLinks = styled.div`
  display: flex;
  gap: 1.5rem;
`;

const NLink = styled(Link)`
  color: white;
  text-decoration: none;
  font-weight: bold;
  &:hover {
    color: #f0f0f0;
  }
`;

const NBar = () => {
  return (
    <NContainer>
      <h1>My Blog</h1>
      <NLinks>
        <NLink to="/">Home</NLink>
        <NLink to="/blogs">Blogs</NLink>
        <NLink to="/about">About</NLink>
        <NLink to="/contact">Contact</NLink>
        <NLink to="/login">Sign In</NLink>
        <NLink to="/register">Register</NLink>
      </NLinks>
    </NContainer>
  );
};

export default NBar;
